import axios from 'axios';

function App() {
    const [user, setUser] = useState('')

    useEffect(() => {
        axios.get('/api/v1/user')
            .then(response => setUser(response.data))
            .catch(error => console.log(error))
    }, []);

    return (
        <div>
            백엔드에서 가져온 데이터입니다 : {hello}
        </div>
    );
}

export default App;
